import React, { useState } from 'react'
import { Link } from 'react-router-dom';


///////////////////////IMPORT DOS COMPONENTES + CSS//////////////////////////////
import "./senhaRecover.css"
//////////////////////////////////////////////////////////////////////////

function senhaRecover(){
      

    return(
        <>
                    <div class='rec.senha'>
                        <h6>Digite seu email</h6>
                        <input type='email' 
                            id='usuario' 
                            placeholder='Digite seu Email' 
                        >
                        </input>
                            <button id='recover' >Recuperar</button>
                        
                    </div>
        </>
    )
}

export default senhaRecover
